  true,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then                                 U.S. Census Bureau's Master Address File
  / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
  (MTDB).n                                 The MTDB represents a seamless national
  file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed ton                                 stand alone as an independent data
  set, or they can be combined to cover the entire nation. n                                 n
  \                                The Rails Shapefile includes all features within
  the MTDB Super Class \"Rail Features\" distinguished where the MAF/TIGER Featuren
  \                                Classification Code (MTFCC) for the feature in
  MTDB that begin with \"R\".  This includes main lines such as spur lines, rail yards,
  massn                                 transit rail lines such as carlines, streetcar
  track, monorail or other mass transit rail and special purpose rail lines such as
  cogn                                 rail lines, incline rail lines and trams.n
